{{Infobox school | name = గేప్స్ కుందాడ | city = కుందాడ గ్రామం, ఈస్ట్ గోదావరి జిల్లా | district = ఈస్ట్ గోదావరి జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు | students = నలభై మంది | faculty = ఐదుగురు }}
ఈ పాఠశాల కుందాడ గ్రామంలో ఉన్నది. ఈ గ్రామం ఈస్ట్ గోదావరి జిల్లాలో మారిడమిల్లి పరిధిలో ఉన్నది. ఈ పాఠశాల ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ వచ్చి 28140104601. టి.వి. డీపీటీ.’ అంటూ ట్వీట్ చేశారు. అష్రామ్ పాఠశాలలు నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇక్కడ విద్యార్థులకు ఐదవ తరగతి వరకూ తెలుగు మాధ్యమంలో భోదించబడుతుంది. ఇది బాల బాలికల పాఠశాల. ఇక్కడ ఇరవై తొమ్మిది మంది బాలురు పదకొండు మంది బాలికలు , మొత్తం నలభై మంది విద్యార్థులు విద్యని అభ్యసిస్తున్నారు. ఇక్కడ ఐదుగురు ఉపాధ్యాయులు ఉన్నారు. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.==మూలాలు== {{Reflist}}
