{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ( బి.సి) డి.డి.పాదుడు | city = దొడ్డా దేవరపాడు గ్రామం, కృష్ణ జిల్లా | district = కృష్ణ జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు | students = ముప్పై ఏడు మంది | faculty = ఇద్దరు }}
కృష్ణ జిల్లాలో వెరుళ్లపడు పరిధిలో దొడ్డా దేవరపాడు గ్రామంలో ఈ మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ఉన్నది. ఈ పాఠశాల ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ వచ్చి 28160700201. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇక్కడ విద్యార్థులకు ఐదవ తరగతి వరకూ తెలుగు మాధ్యమంలో చదువు చెప్తారు ఇది బాల బాలికల పాఠశాల. మొత్తం ముప్పై ఏడు మంది విద్యార్థులలో పందొమ్మిది మంది బాలురు పధ్ధెనిమిది మంది బాలికలు ఈ పాఠశాల లో విద్యని అభ్యసిస్తున్నారు. ఇక్కడ ఒక ఉపాధ్యాయుడు ఒక ఉపాధ్యాయిని, మొత్తం ఇద్దరు ఉపాధ్యాయులు ఉన్నారు. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.==మూలాలు== {{Reflist}}
