{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) యాదరాళ్ల | city = వెల్దుర్తి గ్రామం, కుర్నూల్ జిల్లా | district = కుర్నూల్ జిల్లా | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు, ఇంగ్లీష్ | students = యాభై నాలుగు మంది | faculty = ఇద్దరు }}
ఈ మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) వెల్దుర్తి గ్రామంలో ఉన్నది. కుర్నూల్ జిల్లాలో వెల్దుర్తి పరిధిలో ఈ గ్రామం ఉన్నది. ఈ పాఠశాల ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ వచ్చి 28212901006. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇక్కడ విద్యార్థులకు ఐదవ తరగతి వరకూ తెలుగు, ఇంగ్లీష్ మాధ్యమంలో చదువు చెప్తారు ఇది బాల బాలికల పాఠశాల. ఈ పాఠశాలలో మొత్తం యాభై నాలుగు మంది విద్యార్థులు విద్యని అభ్యసిస్తున్నారు. వీరిలో ఇరవై రెండు మంది బాలురు ముప్పై రెండు మంది బాలికలు ఉన్నారు. ఇక్కడ ఇద్దరు ఉపాధ్యాయులు ఉన్నారు, వీరిలో అందరూ ఉపాధ్యాయినులే. <ref>{{cite web |title =School Directory |url = http://schoolreportcards.in/SRC-New/SchoolDirectory/Directory.aspx |website = schoolreportcards.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2017-18 విద్యా సంవత్సరమునకు సంబంధించినవి.==మూలాలు== {{Reflist}}
